(2, 'return_policy', '<p><div id=\"full-help-page\" style=\"box-sizing: border-box;\"><div style=\"box-sizing: border-box;\"><div data-module=\"1801\" data-title=\"\" style=\"box-sizing: border-box;\"><div class=\"help-content\" style=\"box-sizing: border-box;\"><div style=\"box-sizing: border-box;\"><h2 style=\"box-sizing: border-box; padding: 14px 0px 0px; margin: 0px 0px 16px; text-rendering: optimizelegibility; line-height: 1.2;\"><span style=\"box-sizing: border-box; margin: 0px; outline: 0px; font-family: &quot;Times New Roman&quot;, Times, serif; font-size: 48px; color: rgb(0, 0, 0);\">Seller code of conduct</span></h2><p><span style=\"color: rgb(204, 0, 0);\">Amazon enables you to reach hundreds of millions of customers. We strive to ensure a fair and trustworthy buyer and seller experience. At Amazon, we expect you to adhere to the code of conduct principles outlined below. Violation of the code of conduct principles may result in the loss of your selling privileges and removal from Amazon Marketplace.</span></p><p style=\"color: rgb(17, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); box-sizing: border-box; padding: 0px; margin: 0px 0px 24px; line-height: 1.5em;\">Seller Code of Conduct Principles:</p><ul class=\"a-vertical\" style=\"color: rgb(17, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); box-sizing: border-box; margin: 0px 0px 0px 18px; padding: 0px; font-size: 15px;\"><li style=\"box-sizing: border-box; list-style: disc; overflow-wrap: break-word; margin: 0px 0px 4px;\"><span class=\"a-list-item\" style=\"box-sizing: border-box; color: rgb(0, 0, 255); margin: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-size: 15px;\">Adhere to all applicable laws and abide by all Amazon policies.</span></li><li style=\"box-sizing: border-box; list-style: disc; overflow-wrap: break-word; margin: 0px 0px 4px;\"><span class=\"a-list-item\" style=\"box-sizing: border-box; color: rgb(0, 0, 255); margin: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-size: 15px;\">Maintain current account information.</span></li><li style=\"box-sizing: border-box; list-style: disc; overflow-wrap: break-word; margin: 0px 0px 4px;\"><span class=\"a-list-item\" style=\"box-sizing: border-box; color: rgb(0, 0, 255); margin: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-size: 15px;\">Never misrepresent yourself.</span></li><li style=\"box-sizing: border-box; list-style: disc; overflow-wrap: break-word; margin: 0px 0px 4px;\"><span class=\"a-list-item\" style=\"box-sizing: border-box; color: rgb(0, 0, 255); margin: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-size: 15px;\">Always act in a manner that ensures a trustworthy experience for Amazon customers.</span></li><li style=\"box-sizing: border-box; list-style: disc; overflow-wrap: break-word; margin: 0px 0px 4px;\"><span class=\"a-list-item\" style=\"box-sizing: border-box; color: rgb(0, 0, 255); margin: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-size: 15px;\">Never list products that may cause harm to Amazon customers.</span></li><li style=\"box-sizing: border-box; list-style: disc; overflow-wrap: break-word; margin: 0px 0px 4px;\"><span class=\"a-list-item\" style=\"box-sizing: border-box; color: rgb(0, 0, 255); margin: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-size: 15px;\">Never engage in any misleading, inappropriate or offensive behavior. This applies to all your activities, including but not limited to:</span><span class=\"a-list-item\" style=\"box-sizing: border-box; color: rgb(255, 0, 255); margin: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-size: 15px;\"><ul class=\"a-vertical\" style=\"font-size: 15px; box-sizing: border-box; margin: 0px 0px 0px 18px; color: rgb(17, 17, 17); padding: 0px;\"><li style=\"box-sizing: border-box; list-style: circle; overflow-wrap: break-word; margin: 0px 0px 4px;\"><span class=\"a-list-item\" style=\"box-sizing: border-box; color: rgb(17, 17, 17); margin: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-size: 15px;\">Information provided on your account</span></li><li style=\"box-sizing: border-box; list-style: circle; overflow-wrap: break-word; margin: 0px 0px 4px;\"><span class=\"a-list-item\" style=\"box-sizing: border-box; color: rgb(17, 17, 17); margin: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-size: 15px;\">Information provided in listings, content or images</span></li><li style=\"box-sizing: border-box; list-style: circle; overflow-wrap: break-word; margin: 0px 0px 4px;\"><span class=\"a-list-item\" style=\"box-sizing: border-box; color: rgb(17, 17, 17); margin: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-size: 15px;\">Communication between you and Amazon or you and our customers</span></li></ul></span></li><li style=\"font-size: 15px; box-sizing: border-box; list-style: disc; overflow-wrap: break-word; margin: 0px 0px 4px;\"><span class=\"a-list-item\" style=\"box-sizing: border-box; color: rgb(255, 0, 255); margin: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-size: 15px;\">Act fairly at all times. Unfair behavior includes but is not limited to the following:<ul class=\"a-vertical\" style=\"box-sizing: border-box; margin: 0px 0px 0px 18px; color: rgb(17, 17, 17); padding: 0px;\"><li style=\"box-sizing: border-box; list-style: circle; overflow-wrap: break-word; margin: 0px 0px 4px;\"><span class=\"a-list-item\" style=\"box-sizing: border-box; color: rgb(17, 17, 17); margin: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-size: 15px;\">Behavior that could be deemed as manipulation or \"gaming\" of any part of the buying or selling experience</span></li><li style=\"box-sizing: border-box; list-style: circle; overflow-wrap: break-word; margin: 0px 0px 4px;\"><span class=\"a-list-item\" style=\"box-sizing: border-box; color: rgb(17, 17, 17); margin: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-size: 15px;\">Actions that could be perceived as manipulating customer reviews, including by directly or indirectly contributing false, misleading or inauthentic content</span></li><li style=\"box-sizing: border-box; list-style: circle; overflow-wrap: break-word; margin: 0px 0px 4px;\"><span class=\"a-list-item\" style=\"box-sizing: border-box; color: rgb(17, 17, 17); margin: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-size: 15px;\">Activities that could be perceived as attempting to manipulate Amazon\'s search results or sales rankings</span></li><li style=\"box-sizing: border-box; list-style: circle; overflow-wrap: break-word; margin: 0px 0px 4px;\"><span class=\"a-list-item\" style=\"box-sizing: border-box; color: rgb(17, 17, 17); margin: 0px; outline: 0px; font-weight: inherit; font-style: inherit; font-size: 15px;\">Actions that intentionally damage another seller, their listings or their ratings</span></li></ul></span></li></ul><span style=\"color: rgb(255, 0, 255); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initia